# Taking care of void suits in the above predeals

def sanitize_deal(predeal):
    for k, v in predeal.items():
        predeal[k] = re.sub(r'^ ', "- ", predeal[k])
        predeal[k] = re.sub(r' $', " -", predeal[k])
        predeal[k] = re.sub(r'  ', " - ", predeal[k])
    return predeal


testno = 0
numpassed = 0

for _ in testcases:
    testno += 1
    assert len(_) == 8

    predeal = sanitize_deal(_[0])
    factory = Deal.prepare(_[0])
    dealer = _[1].capitalize()
    nsvul = _[2]
    ewvul = _[3]
    expected_score = _[4]
    expected_contract = _[5]
    expected_declarer = _[6].capitalize()
    expected_auction = _[7]

    nextdeal = factory()
    nextdeal.set_str_style("long")

    ret = nextdeal.parscore(dealer, nsvul, ewvul)
    actual_contract = str(ret[0])
    actual_declarer = str(ret[1])
    actual_score = ret[2]
    actual_auction = ret[4]

    output = f"Deal number {testno}" \
             f"{nextdeal}\n"\
             f"expected:{expected_contract} by '{expected_declarer}' " \
             f"expected_score={expected_score}\n" \
             f"expected_auction={expected_auction}\n" \
             f"actual: {actual_contract} by '{actual_declarer}' "\
             f"actual_score={actual_score}\n" \
             f"actual_auction={actual_auction}\n" \
             f"Deal number {testno} \n"
    try:
        assert actual_score == expected_score, \
            f"{output}\n Test number {testno} score failed" \
            f"expected '{expected_score}', actual '{actual_score}'"
        assert actual_contract == expected_contract, \
            f"{output}\n Test number {testno} contract failed" \
            f"expected '{expected_contract}', actual '{actual_contract}'"
        assert actual_declarer == expected_declarer,\
            f"{output}\n Test number {testno} declarer failed "\
            f"expected '{expected_declarer}', actual '{actual_declarer}'"
        assert actual_auction == expected_auction,\
            f"{output}\n Test number {testno} auction failed "\
            f"expected '{expected_auction}', actual '{actual_auction}'"
        numpassed += 1
        print(f"{numpassed} tests out of {testno} passed so far")
    except AssertionError as error:
        print(f"Error caught: {error}")

print(f"{numpassed} tests out of {testno} tests passed")
